// src/components/Admin.js
import React, { useState } from "react";
import ProductionPanel from "./ProductionPanel";
import ElectricalPanel from "./ElectricalPanel";
import CumulativePanel from "./CumulativePanel";

const Admin = () => {
  const [activeTab, setActiveTab] = useState("production");

  return (
    <div style={{ padding: "2rem" }}>
      <h2>‚öôÔ∏è Admin Dashboard</h2>

      <div style={{ marginBottom: "1rem" }}>
        <button onClick={() => setActiveTab("production")}>üìä Production</button>
        <button onClick={() => setActiveTab("electrical")}>‚ö° Electrical</button>
        <button onClick={() => setActiveTab("cumulative")}>üìà Cumulative</button>
      </div>

      {activeTab === "production" && <ProductionPanel />}
      {activeTab === "electrical" && <ElectricalPanel />}
      {activeTab === "cumulative" && <CumulativePanel />}
    </div>
  );
};

export default Admin;
